import { useState } from "react";
const Home = () => {
   
  const [blogs,setBlogs] =useState([
      {
         ad:"Yeni Başlayanlar İçin C#",
         aciklama:"lorem ipsum",
         yazar:"luffy",
         id:1
      },
      {
         ad:"React öğreniyorum",
         aciklama:"lorem ipsum",
         yazar:"zorro",
         id:2
      },
      {
         ad:"İleri Seviye c#",
         aciklama:"lorem ipsum",
         yazar:"sanji",
         id:3
      },
      {
         ad:"İleri Seviye f#",
         aciklama:"lorem ipsum",
         yazar:"aliveli",
         id:4
      }

   ])

   return (
      <div className="home">
         {
              blogs.map((blog)=>(
                    <div className="blog-preview" >
                       <h2>{blog.ad}</h2>
                    </div>
              ))}
      </div>
   );
}
export default Home;
